ment with a matching pouch to organize the essentials. Its leather strap closure keeps items secure while the D of the CD&nbsp;Lock closure twists to adjust the sides and enhance the bag\'s silhouette. The leather handles can be adjusted using the small notches in order to be able to carry the medium bag by hand or wear it over the shoulder.</div><div class=\"CoutureDescription_couture-description__block__cY7NN\" style=\"font-size: 0.8125rem; line-height: 1.25rem; margin: 1.5rem 0px 0px;\"><ul style=\"padding: 0px 0px 0px 1rem; margin: 0px;\"><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">CD&nbsp;Lock and strap closures</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">D.I.O.R. charms</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Removable interior pouch</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Adjustable leather handles</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Dust bag included</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Made in Italy</li></ul><div><br></div><div><button class=\"ProductDescriptionItem_title__OZQ_j\" aria-expanded=\"true\" style=\"font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; position: relative; border-width: initial; border-style: none; border-color: initial; padding: 0.8125rem 0px; display: flex; width: 566.667px; justify-content: space-between; align-items: center; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><span class=\"ProductDescriptionItem_title-value__f5_TY\" aria-atomic=\"true\" aria-