=\"true\" class=\"icon\"><svg width=\"20\" height=\"20\" viewBox=\"0 0 20 20\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M15.39 11.61L10 6.22l-5.39 5.39a.551.551 0 10.78.78L10 7.78l4.61 4.61a.56.56 0 00.78 0 .56.56 0 000-.78z\" fill=\"currentColor\"></path></svg></span></span></button><div class=\"ProductDescriptionItem_content__2kej8\" aria-hidden=\"false\" style=\"width: 573.333px; color: rgb(0, 0, 0); font-family: &quot;Century Gothic Std&quot;, arial, sans-serif; font-size: medium; background-color: rgb(246, 246, 246);\"><div>The Roller bag with strap is back in a new version that combines the House\'s codes of elegance with functional design. The style is crafted in beige and black Dior Oblique jacquard embellished with a Dior signature. The zipped compartment, enhanced by a Saddle flap in black grained calfskin, will accommodate all the essentials. The detachable handle and adjustable and removable leather strap will allow the miniature bag to be carried by hand, worn over the shoulder or crossbody.</div><div class=\"CoutureDescription_couture-description__block__cY7NN\" style=\"font-size: 0.8125rem; line-height: 1.25rem; margin: 1.5rem 0px 0px;\"><ul style=\"padding: 0px 0px 0px 1rem; margin: 0px;\"><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Beige and black Dior Oblique jacquard</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Black grained calfskin</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Ruthenium-finish brass Dior signature on front</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Embossed Dior signature on interior</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Removable leather top handle</li><li style=\"list-style