n</li><li style=\"list-style-type: disc; padding: 0px; margin: 0px; font-size: 0.8125rem; line-height: 1.25rem;\">Made in Italy</li></ul><div><br></div><div><button class=\"ProductDescriptionItem_title__OZQ_j\" aria-expanded=\"true\" style=\"font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; position: relative; border-width: initial; border-style: none; border-color: initial; padding: 0.8125rem 0px; display: flex; width: 573.333px; justify-content: space-between; align-items: center; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><span class=\"ProductDescriptionItem_title-value__f5_TY\" aria-atomic=\"true\" aria-live=\"polite\" style=\"font-size: 0.8125rem; line-height: 1.25rem; font-family: &quot;Century Gothic Std Bold&quot;, &quot;Noto Sans JP&quot;, &quot;Noto Sans SC&quot;, &quot;Noto Sans TC&quot;, &quot;Noto Sans KR&quot;; text-transform: uppercase; text-align: left;\">SIZE &amp; FIT</span><span class=\"arrow-icon arrow-icon--top ProductDescriptionItem_title-arrow__lx9RD\" style=\"display: inline-flex; cursor: pointer; line-height: 0rem; height: auto; padding-top: 0px;\"><span aria-hidden=\"true\" class=\"icon\"><svg width=\"20\" height=\"20\" viewBox=\"0 0 20 20\" fill=\"none\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M15.39 11.61L10 6.22l-5.39 5.39a.551.551 0 10.78.78L10 7.78l4.61 4.61a.56.56 0 00.78 0 .56.56 0 000-.78z\" fill=\"currentColor\"></path></svg></span></span></button><div class=\"ProductDescriptionItem_content__2kej8\" aria-hidden=\"false\" style=\"width: 573.333px; font-size: medium;\"><div class=\"CoutureDescription_couture-description__block__cY7NN CoutureDescription_couture-description__block--with-padding__Rysd2\" style=\"font-size: 0.8125rem; line-height: 1.25rem; padding-bottom: 1.25rem;\"><ul style=\"padding: 0px 0px 0px 1rem; margin: 0px;\"><li style=\"list-style-type: disc;